import React from "react";
import {
  BrowserRouter ,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (


      <BrowserRouter>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
        <hr />
        <Routes>
          <Route path="/" element={Home} />
        </Routes>
      </BrowserRouter>

  )
}

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}




export default App;
